const App = () => {
    const course = 'Half Stack application development'
    const parts = [
      {
        name: 'Fundamentals of React',
        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]

  return (
    <div>
      <Header name={course}></Header>
      <Content part1={parts[0]} part2={parts[1]} part3={parts[2]}></Content>
      <Total exercise1 = {part1} exercise2 = {part2} exercise3 = {part3}></Total>
    </div>
  )
}
const Header = (props) => {
  return(
  <h1>{props.name}</h1>
  )
}
const Content = (props) => {
  return(
  <div>
    <Part name = {props.part1.name} exercises = {props.part1.exercises}></Part>
    <Part name = {props.part2.name} exercises = {props.part2.exercises}></Part>
    <Part name = {props.part3.name} exercises = {props.part3.exercises}></Part>
  </div>
  )
}
const Part = (props) => {
  return(<p>
    {props.name} {props.exercises}
  </p>)
}
const Total = (props) => {
  return(
  <p>Number of exercises {props.exercise1.exercises+props.exercise2.exercises+props.exercise3.exercises}</p>
  )
}
export default App
